// import logo from './logo.svg';
import './App.css';
// import . from './products';
import {apple, doubleChocolate, original} from './product';

import Roll from './Roll.js';

function App() {
  return (
    <div class="cinnamon-roll">
      <img src={original} alt="a plain cinnamon roll"/>
      <b> Original cinnamon roll </b>

      <div class="options-box">
          <p class="options-label">Glazing: </p>
          <select name="Glazing" class="options">
            <option value="keep-original">Keep original</option>
            <option value="sugar-milk">Sugar milk</option>
            <option value="vanilla-milk">Vanilla milk</option>
            <option value="double-chocolate">Double chocolate</option>
          </select>
      </div>

      <div class="options-box">
        <p class="options-label">Pack size: </p>
        <div class="options">
          <button type="button" class="size"> 1 </button>
          <button type="button" class="size"> 3 </button>
          <button type="button" class="size"> 6 </button>
          <button type="button" class="size"> 12 </button>
        </div>      
      </div>

      <div class="options-box">
        <b>$ 2.49 </b>
        <button type="button" class="add-to-cart"> Add to cart </button>
      </div>

      <Roll 
        imageURL="assets/warhol-frog.png" 
        // noteTitle="This is the First Note" 
        // noteBody="Here is some body text for the first note." 
        // noteFooter="Sep 1 2022, 10:25" 
        />
    </div>
  );
}

export default App;
